  return (
    <Flex
      as="nav"
      bg="teal.500"
      color="gray.50"
      align="center"
      justify="space-between"
    >
      <Heading as="h1" fontSize={{ base: "md", md: "lg" }}>
        シフト管理アプリ
      </Heading>
    </Flex>
  );
});
